import { useState } from "react"

const Trades = () => {
    const [trades, getTrades] = useState([
        {
            id: 1,
            text: 'Trade 1',
            sent: 'Chase',
            received: 'JJ',
        },
        {
            id: 2,
            text: 'Trade 2',
            sent: 'Chase',
            received: 'Three 1sts',
        },
        {
            id: 3,
            text: 'Trade 3',
            sent: 'Jacobs',
            received: 'Dalvin Cook + 2.09',
        }
    ])
    
    return (
        <>
            {trades.map((trade) => (
                <h3 key={trade.id}>{trade.text}</h3>
            ))}
        </>
    )
}

export default Trades
